import React, { Component } from "react";
import {
	StyleSheet,
	Text,
	View,
	Image,
	TouchableWithoutFeedback,
	StatusBar,
	TextInput,
	SafeAreaView,
	Keyboard,
	TouchableOpacity,
	KeyboardAvoidingView,
	AppRegistry,
	Dimensions,
} from "react-native";
import BG2 from "../assets/images/bg.png"; 

class LoginScreen extends Component {
  render() {
    const { navigation } = this.props;

    return (
			<SafeAreaView style={styles.container}>
				<StatusBar barStyle="light-content" />
				<KeyboardAvoidingView behavior="padding">
					<TouchableWithoutFeedback onPress={Keyboard.dismiss}>
						<View>
							<Text style={styles.headText}>Logo Here</Text>
							<Text style={styles.headText}>Welcome To Lift Lae Ly</Text>
							<Image
								source={BG2}
								style={{ width: 350, height: 350, marginStart: 20 }}
							/>

							<View>
								<TouchableOpacity
									onPress={() => navigation.navigate("Dashboard")}
								>
									<Text>SIGN IN</Text>
								</TouchableOpacity>
							</View>
						</View>
					</TouchableWithoutFeedback>
				</KeyboardAvoidingView>
			</SafeAreaView>
		);
  }
}
const android = Dimensions.get("window");
const styles = StyleSheet.create({
	container: {
		display:'flex',
		width: android.width1 * 1.5,
		height: android.height * 1.5,
	},
	headText:{
		display:'flex',
		justifyContent:'space-between'
	}
	
});

export default LoginScreen;
